const possibleCategories = [
  'twoColorFlag',
  'threeColorFlag',
  'flagHasBlack',
  'flagHasPurple',
  'isInAsia',
  'isPartOfEuropeanUnion',
  'hasArabicAsOfficialLanguage',
  'flagWithGreen',
  'isPartOfNileRiverSystem',
  'isPartOfAmazonRiverSystem',
  'startsWithE',
  'startsWithB',
  'startsWithA',
  'capitalIsNotMostPopulousCity',
  'isInAfrica',
  'isInNorthAmerica',
  'isInSouthAmerica',
  'borders1to2Countries',
  'borders3to4Countries',
  'borders5to6Countries'
];

const elements = {
  startBtn: document.getElementById('start_button'),
  status: document.getElementById('status'),
  input: document.getElementById('country-input'),
  submit: document.getElementById('submit-btn'),
  close: document.getElementById('close-overlay'),
  overlay: document.getElementById('overlay'),
  suggestions: document.getElementById('country-suggestions'),
  overlayInstructions: document.getElementById('overlay-instructions'),
  notice: document.getElementById('notice'),
  topicIds: ['topic1', 'topic2', 'topic3', 'topic4', 'topic5', 'topic6'].map((id) => document.getElementById(id)),
  squares: Array.from(document.querySelectorAll('.option'))
};

const state = {
  rowTopics: [],
  colTopics: [],
  activeSquare: null,
  placedCountries: {}, // key = square id, value = country name
  gameStarted: false
};

function shuffle(list) {
  return [...list].sort(() => Math.random() - 0.5);
}

function hasConflicts(topicList) {
  const regionTopics = topicList.filter((t) => ['isInAfrica', 'isInNorthAmerica', 'isInSouthAmerica', 'isInAsia'].includes(t));
  if (regionTopics.length > 1) return true;

  if (topicList.includes('hasArabicAsOfficialLanguage') && (topicList.includes('isInNorthAmerica') || topicList.includes('isInSouthAmerica'))) {
    return true;
  }
  return false;
}

function countryMatches(rowTopic, colTopic) {
  return Object.values(countries).some((data) => data[rowTopic] && data[colTopic]);
}

function topicsFillable(rowTopics, colTopics) {
  return rowTopics.every((r) => colTopics.every((c) => countryMatches(r, c)));
}

function pickTopics() {
  let validSet = null;
  for (let attempt = 0; attempt < 400; attempt += 1) {
    const shuffled = shuffle(possibleCategories);
    const proposed = shuffled.slice(0, 6);
    if (hasConflicts(proposed)) continue;
    const rows = proposed.slice(0, 3);
    const cols = proposed.slice(3, 6);
    if (topicsFillable(rows, cols)) {
      validSet = { rows, cols };
      break;
    }
  }
  if (!validSet) {
    validSet = {
      rows: ['flagHasBlack', 'flagWithGreen', 'capitalIsNotMostPopulousCity'],
      cols: ['startsWithA', 'startsWithB', 'threeColorFlag']
    };
  }
  state.rowTopics = validSet.rows;
  state.colTopics = validSet.cols;
}

function topicLabel(topicKey) {
  const mapping = {
    twoColorFlag: 'Two-color flag',
    threeColorFlag: 'Three-color flag',
    flagHasBlack: 'Flag has black',
    flagHasPurple: 'Flag has purple',
    isInAsia: 'In Asia',
    isPartOfEuropeanUnion: 'EU member',
    hasArabicAsOfficialLanguage: 'Arabic Official Language',
    flagWithGreen: 'Flag has green',
    isPartOfNileRiverSystem: 'Part of Nile System',
    isPartOfAmazonRiverSystem: 'Part of Amazon System',
    startsWithE: 'Starts with E',
    startsWithB: 'Starts with B',
    startsWithA: 'Starts with A',
    capitalIsNotMostPopulousCity: 'Capital not most populous',
    isInAfrica: 'In Africa',
    isInNorthAmerica: 'In N. America',
    isInSouthAmerica: 'In S. America',
    borders1to2Countries: 'Borders 1-2 countries',
    borders3to4Countries: 'Borders 3-4 countries',
    borders5to6Countries: 'Borders 5-6 countries'
  };
  return mapping[topicKey] || topicKey;
}

function renderTopics() {
  // layout: topic1-3 are columns headers, topic4-6 are row headers
  const [t1, t2, t3, t4, t5, t6] = elements.topicIds;
  t1.textContent = topicLabel(state.colTopics[0]);
  t2.textContent = topicLabel(state.colTopics[1]);
  t3.textContent = topicLabel(state.colTopics[2]);
  t4.textContent = topicLabel(state.rowTopics[0]);
  t5.textContent = topicLabel(state.rowTopics[1]);
  t6.textContent = topicLabel(state.rowTopics[2]);
}

function resetBoard() {
  state.placedCountries = {};
  state.activeSquare = null;
  state.gameStarted = true;
  elements.input.value = '';
  elements.status.textContent = 'Topics set. Click a square to start placing countries.';
  elements.squares.forEach((sq) => {
    sq.textContent = '';
    sq.classList.remove('success', 'active-square', 'flash-red', 'filled');
  });
}

function startGame() {
  pickTopics();
  renderTopics();
  resetBoard();
  closeOverlay();
}

function clearActive() {
  elements.squares.forEach((sq) => sq.classList.remove('active-square'));
}

function openOverlay() {
  elements.overlay.classList.remove('hidden');
  elements.input.focus();
  renderSuggestions('');
}

function closeOverlay() {
  elements.overlay.classList.add('hidden');
  elements.input.value = '';
  renderSuggestions('');
  clearActive();
  state.activeSquare = null;
}

function selectSquare(squareEl) {
  if (!state.gameStarted) {
    elements.status.textContent = 'Press New Game first to generate topics.';
    return;
  }
  if (state.placedCountries[squareEl.id]) {
    elements.status.textContent = 'This square is already filled. Pick another.';
    return;
  }
  if (state.activeSquare === squareEl) {
    closeOverlay();
    return;
  }
  clearActive();
  state.activeSquare = squareEl;
  squareEl.classList.add('active-square');
  const row = Number(squareEl.dataset.row);
  const col = Number(squareEl.dataset.col);
  const rowTopic = topicLabel(state.rowTopics[row]);
  const colTopic = topicLabel(state.colTopics[col]);
  elements.status.textContent = `Selected square: needs "${rowTopic}" AND "${colTopic}". Type a country and press Select.`;
  elements.overlayInstructions.textContent = `Needs "${rowTopic}" AND "${colTopic}".`;
  openOverlay();
}

function normalize(str) {
  return str.trim().toLowerCase();
}

function getCountryByName(name) {
  const key = Object.keys(countries).find((c) => normalize(c) === normalize(name));
  return key ? { name: key, data: countries[key] } : null;
}

function validatePlacement(countryData, squareEl) {
  const row = Number(squareEl.dataset.row);
  const col = Number(squareEl.dataset.col);
  const rowTopic = state.rowTopics[row];
  const colTopic = state.colTopics[col];
  const data = countryData.data;
  return Boolean(data[rowTopic] && data[colTopic]);
}

function renderSuccess(squareEl, countryData) {
  squareEl.classList.remove('flash-red');
  squareEl.classList.add('success', 'filled');
  squareEl.innerHTML = `<div>${countryData.name}</div>`;
  state.placedCountries[squareEl.id] = countryData.name;
}

function flashFail(squareEl) {
  squareEl.classList.remove('success');
  squareEl.classList.add('flash-red');
  setTimeout(() => squareEl.classList.remove('flash-red'), 650);
}

function showNotice(text, duration = 700) {
  elements.notice.textContent = text;
  elements.notice.classList.remove('hidden');
  setTimeout(() => {
    elements.notice.classList.add('hidden');
  }, duration);
}

function handleSubmit() {
  if (!state.activeSquare) {
    elements.status.textContent = 'Pick a square first.';
    return;
  }
  const countryInput = elements.input.value;
  const countryData = getCountryByName(countryInput);
  if (!countryData) {
    elements.status.textContent = 'Country not found. Try another.';
    flashFail(state.activeSquare);
    return;
  }

  if (Object.values(state.placedCountries).includes(countryData.name)) {
    elements.status.textContent = `${countryData.name} is already used in another square. Try a different country.`;
    flashFail(state.activeSquare);
    showNotice('Country already used in another square');
    return;
  }

  if (validatePlacement(countryData, state.activeSquare)) {
    renderSuccess(state.activeSquare, countryData);
    const row = Number(state.activeSquare.dataset.row);
    const col = Number(state.activeSquare.dataset.col);
    const rowTopic = topicLabel(state.rowTopics[row]);
    const colTopic = topicLabel(state.colTopics[col]);
    elements.status.textContent = `${countryData.name} fits "${rowTopic}" and "${colTopic}".`;
    state.activeSquare.classList.remove('active-square');
    state.activeSquare = null;
    elements.input.value = '';
    closeOverlay();
  } else {
    elements.status.textContent = `${countryData.name} does not match both topics. Try again.`;
    flashFail(state.activeSquare);
  }
}

function renderSuggestions(query) {
  const q = normalize(query);
  if (!q) {
    elements.suggestions.innerHTML = '';
    return;
  }
  const matches = Object.keys(countries)
    .filter((name) => normalize(name).includes(q))
    .slice(0, 8);
  elements.suggestions.innerHTML = matches
    .map((name) => `<div class="suggestion" data-name="${name}">${name}</div>`)
    .join('');
  Array.from(elements.suggestions.children).forEach((node) => {
    node.addEventListener('click', () => {
      elements.input.value = node.dataset.name;
      handleSubmit();
    });
  });
}

function init() {
  elements.squares.forEach((sq) => {
    sq.addEventListener('click', () => selectSquare(sq));
  });
  elements.submit.addEventListener('click', handleSubmit);
  elements.startBtn.addEventListener('click', startGame);
  elements.close.addEventListener('click', closeOverlay);
  elements.input.addEventListener('keydown', (e) => {
    if (e.key === 'Enter') {
      handleSubmit();
    }
  });
  elements.input.addEventListener('input', (e) => renderSuggestions(e.target.value));
  elements.overlay.addEventListener('click', (e) => {
    if (e.target === elements.overlay) closeOverlay();
  });
  window.addEventListener('keydown', (e) => {
    if (e.key === 'Escape') closeOverlay();
  });
  elements.status.textContent = 'Click New Game to generate random topics, then pick a square.';
}

